def find_possible_teams(n):
    s = set()
    e = 2
    for k in range(0, 70):
        b = 2 * e - 3
        c = -2 * n
        d = b * b - 4 * c
        if d >= 0:
            L = 0
            R = d
            while True:
                M = (L + R + 1) // 2
                if L == R:
                    break
                MM = M * M
                if MM > d:
                    R = M - 1
                else:
                    L = M
            if M * M == d:
                x = -b + M
                if x > 0 and x % 2 == 0:
                    x //= 2
                    if x % 2 == 1:
                        s.add(x * e)
                x = -b - M
                if x > 0 and x % 2 == 0:
                    x //= 2
                    if x % 2 == 1:
                        s.add(x * e)
        e <<= 1
    if not s:
        return [-1]
    return sorted(s)

